#include <omp.h>
#include <math.h>
#include <stdio.h>

void default_function_kernel_1(float* __restrict__ T_broadcast_to, float* __restrict__ T_transpose, int num_threads) {
  #pragma omp parallel for num_threads(num_threads)
  for (int i = 0; i < 75; ++i) {
    T_broadcast_to[i] = T_transpose[i / 3];
  }
}

void default_function_kernel_2(float* __restrict__ T_broadcast_to, int num_threads) {
  #pragma omp parallel for num_threads(num_threads)
  for (int i = 0; i < 75; ++i) {
    T_broadcast_to[i] = floorf(T_broadcast_to[i] * 0.3333333333333333f);
  }
}

void default_function_kernel_4(float* __restrict__ T_broadcast_to, float* __restrict__ T_strided_slice, int num_threads) {
  #pragma omp parallel for num_threads(num_threads)
  for (int i = 0; i < 75; ++i) {
    T_strided_slice[i] = T_broadcast_to[i];
  }
}

